import React from "react";
import styled from "styled-components";

const Card = styled.div`
  display: flex;
  width: 1600px;
  height: 800px;
  border: 1px solid black;
`;
const Card_inner = styled.div`
  display: flex;
  width: 1600px;
  height: 800px;
`;

function MidCards({img}) {
  return <Card></Card>;
}

export default MidCards;
